import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import '../../App.css';

import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

export default function ArticleCard (articleContent){
	console.log('articleContent', articleContent);
	return (
		<div>
			<p>{articleContent.articleContent.title}</p>
			<p>{articleContent.articleContent.blurb}</p>
			<img src={articleContent.articleContent.image.url} alt={articleContent.articleContent.image.alt}></img>
			<Card>
				<Card.Img variant="top" src={articleContent.articleContent.image.url} />
				<Card.Body>
				<Card.Text>
					Some quick example text to build on the card title and make up the bulk
					of the card's content.
				</Card.Text>
				</Card.Body>
			</Card>
		</div>

	)
}
